                recomendados.forEach( (e) => console.log(element));
            } 
            }).catch(function (error) {

              console.log(error);

            });
         }
         teste();
        },[]);
    }

    console.log(recomendados , quests);
    return(
        <div className="background">
            <HeaderHome/>
            <main className="">
                <Tabletop/>
                <h5 className='pb-3'>
                Questionários Recomendados
                </h5>
                    <Forms quests={quests} /> 
                <h5 className='pb-3 pt-5'>
                Todos os Questionários
                </h5>
                 <Forms quests={quests}/>
                {authenticated && <Button variant="primary" type="button"  onClick={handleLogout} className="px-5 mb-3 mt-3">
                    Logout
                </Button>
                }
            </main>
        </div> 
    )

}
